window.bookSummaryJSON = "<p>My plan was perfect. My friend needed a date, and my brother's best friend was single. Problem solved.</p> <p>Until I saw Jaeger for the first time in years, and sparks flew in the wrong direction.</p> <p>Jaeger has grown up and bulked up. But that shouldn't matter because I have the perfect life. Really.</p> <p>Only, my plans are beginning to unravel, and now, visions of Jaeger's hard abs, broad shoulders, and intense green eyes fill my head.</p> <p>I should hold back in case my friend is interested. Or in case of a million other reasons. But if Jaeger isn't willing to play by the rules, I don't think I can, either.</p> <p>\"Addictive and marvelously refreshing.\" (Rumpled Sheets Blog)</p> <p>\"Realistic characters and smart writing.\" (Lauren Layne, <i>USA Today</i> best-selling author)</p> <p><b>Grab </b><b><i>Never Date Your Brother's Best Friend</i></b> <b>now!</b></p> <p><i>Never Date Your Brother's Best Friend</i> is the first book in the Never Date series, which features sexy romance and humorous, feel-good happily ever after. This book can be enjoyed as a stand-alone novel, or it can be listened to as a part of the Never Date series.</p> <p><b>Previously titled</b> <b><i>Off Limits</i></b> <b>(Men of Lake Tahoe, Book 1)</b>&nbsp;</p>"; 
